import React from "react";
import Github from "../../Icons/github.png";
import Twitter from "../../Icons/twitter.png";
import coding from "../../Icons/coding.png";
import Linkedin from "../../Icons/linkedin.png";
const Links = () => {
  return (
    <div>
      <a>
        <img src={Github} width="35px" height="35px" alt="github"/>
      </a>
      <a>
        <img src={Twitter} width="35px" height="35px" alt="twitter"/>
      </a>
      <button>+</button>
      <a>
        <img src={coding} width="35px" height="35px" alt="coding" />
      </a>
      <a>
        <img src={Linkedin} width="35px" height="35px" alt="linkedin" />
      </a>
    </div>
  );
};

export default Links;
